    public void NumberofGoodWaystoSplitaString1525() {
        String s = "";
        int iContGood = 0;
        StringBuffer sSubLeft = new StringBuffer();
        StringBuffer sSubRight = new StringBuffer(s.substring(1));
        int iContSubLeft = 0;
        int iContSubRight = contLettersDiffetens(sSubRight.toString());
        for (int i = 0; i < s.length() - 1; i++) {
            sSubLeft.append(s.charAt(i));
            sSubRight = new StringBuffer(s.substring(i + 1));
            if (s.indexOf(s.charAt(i)) != sSubLeft.length() - 1) {
                if (s.substring(i + 1).indexOf(s.charAt(i)) == -1) {
                    iContSubRight--;
                }
                if (iContSubLeft == iContSubRight) {
                    iContGood++;
                }
            } else {
                iContSubLeft++;
                iContSubRight = contLettersDiffetens(sSubRight.toString());
                if (iContSubLeft == iContSubRight) {
                    iContGood++;
                }
            }
        }
        System.out.println(iContGood);
    }

    public int contLettersDiffetens(String sValue) {
        int iReturn = 0;
        for (char i = 'a'; i <= 'z'; i++) {
            if (sValue.indexOf(i) != -1) {
                iReturn++;
            }
        }
        return iReturn;
    }
